import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import './App.css';
import Modal from './components/Modal';
import Background from './components/Background';
import HomePage from './components/Home';
import TestTest from './components/Test';

function App() {
  return (
    <div>
      {/* <Background/> */}
      <div>
        <Router>
          <div>
            <nav>
              <ul>
                <li>
                  <Link to="/">Home</Link>
                </li>
                <li>
                  <Link to="/test">Test</Link>
                </li>
              </ul>
              <Switch>
                <Route exactPath="/">
                  <Home/>
                </Route>
                <Route exactPath="/test">
                  <Test/>
                </Route>
              </Switch>
            </nav>
          </div>
        </Router>
      </div>
      <div>
        {/* <Modal/> */}
      </div>
    </div>
  )
}

function Home() {
  return (
    <div>
      <TestPage/>
    </div>
  )
}

function Test() {
  return (
    <div>
      <HomePage/>
    </div>
  )
}

export default App;
